import Link from "next/link";

function Header() {
    return (
        <div className="header">
            <Link href="/"><a>Home</a></Link>
            |
            <Link href="/portfolio"><a>Portfolio</a></Link>
            |
            <Link href="/bio"><a>About</a></Link>
        </div>
    );
}

export default Header;
